function serviceiana.byname(name)
  for k, item in pairs(serviceiana.list) do
    if name:lower() == item.name then
      return item
    end
  end

  return nil
end

function serviceiana.byport(port)
  for k, item in pairs(serviceiana.list) do
    if port == item.port then
      return item
    end
  end
end


return serviceiana
